import React from 'react';
import { View, Button } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

// Komponente za svaki ekran
function GlavniZbornikScreen() {
  return <View />;
}
function LoginPageScreen() {
  return <View />;
}
function PopisBodovaScreen() {
  return <View />;
}
// ... Dodajte ostale komponente ekrana

const Stack = createStackNavigator();

function HomeScreen({ navigation }) {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      {/* Gumb za Glavni Zbornik */}
      <Button
        title="Glavni Zbornik"
        onPress={() => navigation.navigate('GlavniZbornik')}
      />
      {/* Gumb za Login Page */}
      <Button
        title="Login Page"
        onPress={() => navigation.navigate('LoginPage')}
      />
      {/* Gumb za Popis Bodova */}
      <Button
        title="Popis Bodova"
        onPress={() => navigation.navigate('PopisBodova')}
      />
      {/* ... Dodajte ostale gumbove za navigaciju koristeÄ‡i isti uzorak */}
    </View>
  );
}

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Home" component={HomeScreen} />
        <Stack.Screen name="GlavniZbornik" component={GlavniZbornikScreen} />
        <Stack.Screen name="LoginPage" component={LoginPageScreen} />
        <Stack.Screen name="PopisBodova" component={PopisBodovaScreen} />
        {/* ... Registirajte ostale ekrane ovdje */}
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
